import random
import numpy as np

def pLA(N):
    # We want to choose a random line in the plane as teh target function
    p1=np.random.uniform(-1,1,size=2)
    p2=np.random.uniform(-1,1,size=2)
    slope=(p2[1] - p1[1])/(p2[0]-p1[0])

    def target_function(x):
      return slope*(x - p1[0]) + p1[1]

    def classify_point(x1,x2):
      return np.sign(x2-target_function(x1))

    data=[]
    for i in range(N):
      data.append([1,random.uniform(-1,1),random.uniform(-1,1)])

    # Start the PLA with the weight vector v being all zeroes
    weights=[0, 0, 0]

    def hypothesis(x):
      return np.sign(np.dot(weights,x))

    # At each iteration, have the algorithm choose a point randomly from the set
    # of misclassified points

    # We are interested in two quatities: the number of iterations that PLA takes
    # to converge to g
    def run_pLA():
        num_iterations=0
        i=0
        while i<N:
            if hypothesis(data[i]) != classify_point(data[i][1], data[i][2]):
                for j in range(3):
                    weights[j]=weights[j] + classify_point(data[i][1], data[i][2])*data[i][j]
                i=0
                num_iterations+=1
            else:
                i+=1
        return num_iterations

    # and the diagreement between f and g
    def estimate_disagreement():
        num_misclassified=0
        num_test_points = 100

        for n in range(num_test_points):
            test_point=[1, random.uniform(-1,1),random.uniform(-1,1)]
            if hypothesis(test_point) != classify_point(test_point[1], test_point[2]):
                num_misclassified += 1
        return num_misclassified/num_test_points

    return run_pLA(),estimate_disagreement()

def run_experiment(trials, N):
  total_iterations=0
  total_disagreement=0

  for i in range(trials):
    iterations,disagreement=pLA(N)
    total_iterations+=iterations
    total_disagreement+=disagreement

  print(f"Average iterations for N = {N}: {total_iterations / trials}")
  print(f"Average disagreement for N = {N}: {total_disagreement / trials}")

num_trials=1000
N=10
run_experiment(num_trials,N)

N=100
run_experiment(num_trials,N)

